import { Fragment } from 'react';
import {Outlet, useNavigation} from 'react-router-dom'; //marks the place where child route elements should be rendered to
import MainNavigation from '../components/MainNavigation';

const RootLayout = () => {
    const navigation = useNavigation();
    navigation.state === 'submitting'
    return <Fragment>
        <MainNavigation />
        <Outlet />
    </Fragment>;
}

export default RootLayout;
